import React, { Component } from "react";

class App extends React.Component {
  constructor(props) {
    super(props);

    this.state = {
      totalReactPackages: [],
    };
  }

  componentDidMount() {
    // Simple GET request using fetch
    fetch("https://api.npms.io/v2/search?q=react")
      .then((response) => response.json())
      .then((data) => this.setState({ totalReactPackages: data.results }));
  }

  render() {
    const { totalReactPackages } = this.state;
    return (
      <div className="card text-center m-3">
        <h5 className="card-header">Simple GET Request</h5>
        <div className="card-body">
          Total react packages: {totalReactPackages.length}
          Total react packages:{" "}
          {this.state.totalReactPackages[0]
            ? this.state.totalReactPackages[0].searchScore
            : " "}
          Total react :{" "}
          {this.state.totalReactPackages[0]
            ? this.state.totalReactPackages[0].score.final
            : " "}
          : {console.log(totalReactPackages[0])}
        </div>
      </div>
    );
  }
}

export default App;
